import "./index.css";
import axios from "axios";
import React from "react";

function MainPage() {
  const [products, setProducts] = React.useState([]);

  axios
    .get("https://333b478a-37cc-450f-80d0-23b422a28c01.mock.pstmn.io/products")
    .then(function (result) {
      const products = result.data.products;
      setProducts(products);
    })
    .catch(function (error) {
      console.log("에러발생: ", error);
    });

  return (
    <div>
      <div id="header">
        <div id="header-area">
          <img src="images/icons/logo.png" alt="logoPic" />
        </div>
      </div>
      <div id="body">
        <div id="banner">
          <img src="images/banners/banner1a.PNG" alt="bannerPic" />
        </div>
        <h1>하연이의 사진들</h1>
        <div id="selfie-list">
          {products.map(function (product, index) {
            return (
              <div className="selfie-card">
                <div>
                  <img
                    className="selfie-img"
                    src="images/selfie/bang1.jpg"
                  ></img>
                </div>
                <div className="selfie-contents">
                  <span className="selfie-date">2022.12.28</span>
                  <span className="selfie-short">풀뱅 도전!</span>
                  <div className="selfie-place">
                    <img
                      className="selfie-avatar"
                      src="images/icons/avatar.png"
                    ></img>
                    <span>건대 카페</span>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </div>
      <div id="footer">
        <p id="copy">Copyright 2022. HaYeonKim inc. all rights reserved.</p>
      </div>
    </div>
  );
}

export default MainPage;
